                            price: tools.formatPrice(offer.price.value, offer.price.currencyName || ''),
                            priceValue: offer.price.value,
                            discount: offer.price.discount,
                            oldPrice: tools.formatPrice(Number(offer.price.base), offer.price.currencyName || ''),
                            photo: offer.photo,
